import React, {useState, useEffect} from 'react'
import { observer } from 'mobx-react-lite';
import dictionary from '../store/Dictionary';
// @ts-ignore
// import { Chart } from 'react-charts';
import { Chart } from 'react-google-charts';

interface IChart {
    data: any[]
}

const MyChart = observer(({data}: IChart) => {
    const [dataWords, getDataWords] = useState<any[]>([]);

    useEffect(() => {
        if(!dataWords){
            console.log('DATA', data);
        }
        console.log('START', dictionary.startString)
        console.log('DATA', data);
    }, [dataWords])

    return (
        <div style={{ display: 'flex', maxWidth: 1000 }}>
            <Chart
                width={600}
                height={400}
                chartType="ColumnChart"
                loader={<div>Loading Chart</div>}
                data={[
                    ['City', '2010 Population', '2000 Population'],
                    ['Count words start with the letter', dictionary.startString.length, data.length],
                    ['Count words end with the letter', dictionary.endString.length, data.length],
                    ['times the letter ${string} appear in the dictionary', dictionary.inAll.length, data.length],
                    ['Houston, TX', 2099000, 1953000],
                ]}
                options={{
                    title: 'Queries to dictionary',
                    chartArea: { width: '50%' },
                    hAxis: {
                        title: 'Total Population',
                        minValue: 0,
                    },
                    vAxis: {
                        title: 'Total letters',
                    },
                }}
                legendToggle
            />
        </div>
    )
})

export default MyChart;
